import './css/main.css'
import $ from 'jquery'
import React from 'react'
import ReactDOM from 'react-dom'
import Main from './app/Main'
import Config from './app/config/Config'
$.ajax({
    url: Config.ajaxUrl,
    type: 'post',
    dataType: 'json',
    data: {
        action: 'preloadData'
    }
}).done((ajaxResponse) => {
    ReactDOM.render(<Main data={ajaxResponse} />, document.getElementById('root'))
})
